import React, { useState } from 'react';
import styled from 'styled-components';
import { FaSearch, FaHome, FaList, FaShoppingBag, FaClipboardList } from 'react-icons/fa'; // Import icons
import CategoryCard from './components/CategoryCard';
import ProductCard from './components/ProductCard';

// Sample Data (Replace with your API calls)
const topCategories = [
  { id: 1, name: 'Spices Or Masala', image: 'https://via.placeholder.com/80x80' },
  { id: 2, name: 'Bathing Soaps', image: 'https://via.placeholder.com/80x80' },
  { id: 3, name: 'Baby Care', image: 'https://via.placeholder.com/80x80' },
  { id: 4, name: 'Hair Oil & Hair Cares', image: 'https://via.placeholder.com/80x80' },
  { id: 5, name: 'Toothpaste & Toothbrush', image: 'https://via.placeholder.com/80x80' },
  { id: 6, name: 'Rice Sarees', image: 'https://via.placeholder.com/80x80' },
  { id: 7, name: 'Shampoo & Conditioners', image: 'https://via.placeholder.com/80x80' },
  { id: 8, name: 'Perfumes', image: 'https://via.placeholder.com/80x80' },
];

const products = [
  { id: 1, name: 'Everest Turmeric (Haldi) 200 Gram', image: 'https://via.placeholder.com/150x200', categoryId: 1, price: 49 },
  { id: 2, name: 'Patanjali Turmeric (Haldi) Powder 100 Gram', image: 'https://via.placeholder.com/150x200', categoryId: 1, price: 69 },
  { id: 3, name: 'Patanjali Sabji Masala 100 Gram', image: 'https://via.placeholder.com/150x200', categoryId: 1, price: 79 },
  { id: 4, name: 'Patanjali Cumin (Jeera) Powder', image: 'https://via.placeholder.com/150x200', categoryId: 1, price: 89 },
  // Add more products...
];

const Container = styled.div`
  font-family: sans-serif;
`;

const SearchBarContainer = styled.div`
  display: flex;
  align-items: center;
  padding: 10px;
  background-color: #f2f2f2;
`;

const SearchInput = styled.input`
  flex: 1;
  padding: 8px;
  border: none;
  outline: none;
`;

const CategoryContainer = styled.div`
  display: flex;
  overflow-x: auto; /* Enable horizontal scrolling */
  padding: 10px;
`;

const ProductGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
  gap: 20px;
  padding: 20px;
`;

const Footer = styled.footer`
  background-color: #f2f2f2;
  border-top: 1px solid #ccc;
  display: flex;
  justify-content: space-around;
  align-items: center;
  padding: 10px;
  position: fixed;
  bottom: 0;
  width: 100%;
`;

const FooterIcon = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  cursor: pointer;
`;


function App() {
  const [searchTerm, setSearchTerm] = useState('');
  const [selectedCategory, setSelectedCategory] = useState(null);

  const filteredProducts = products.filter(product =>
    !selectedCategory || product.categoryId === selectedCategory.id
  ).filter(product =>
    searchTerm === '' || product.name.toLowerCase().includes(searchTerm.toLowerCase())
  );


  return (
    <Container>
      <SearchBarContainer>
        <SearchInput type="text" placeholder="Search for products..." value={searchTerm} onChange={(e) => setSearchTerm(e.target.value)} />
        <FaSearch size={20} color="#333" style={{marginLeft: '10px'}}/>
      </SearchBarContainer>

      <CategoryContainer>
        {topCategories.map((category) => (
          <CategoryCard key={category.id} category={category} setSelectedCategory={setSelectedCategory} />
        ))}
      </CategoryContainer>

      <h2>{selectedCategory ? selectedCategory.name : 'All Products'}</h2>
      <ProductGrid>
        {filteredProducts.map((product) => (
          <ProductCard key={product.id} product={product} />
        ))}
      </ProductGrid>

      <Footer>
        <FooterIcon><FaHome size={24} /><p>Home</p></FooterIcon>
        <FooterIcon><FaList size={24} /><p>Categories</p></FooterIcon>
        <FooterIcon><FaShoppingBag size={24} /><p>Bag</p></FooterIcon>
        <FooterIcon><FaClipboardList size={24} /><p>Orders</p></FooterIcon>
      </Footer>
    </Container>
  );
}

export default App;
